import React from 'react'
import './App.css';

class App extends React.Component {
    render() {

      let isTestCreated = false
      const createTest = () => {
        if(!isTestCreated) {
          console.log("asdad")
          document.getElementById("test").style.display = "block";
          isTestCreated = true
        }
      }

      return (
        <div className="App">
          <h4>Система тестирования</h4>

          <input placeholder="Введите название теста"/>
          <button onClick={createTest}>Создать</button>

          <div className="test">

          </div>
        </div>
      )
    }
}

export default App;
